def convert_to_char(k):
	mod = k % 27
	if mod == 26:
		return ' '
	return chr(97 + mod)

def decode_message(sequence):
	'''
	Decode hidden message based on permutation of triples
	Input:  list of non-negative integers
	Output: string corresponding to hidden message
	'''
	library={}
	result = ['']*len(sequence)
	for i in range(len(sequence)-2):

		sort_triple = tuple(sorted(sequence[i:i+3]))
		# print(type(library.get(sort_triple,[])))
		if type(library.get(sort_triple,[])) == type([]):
			new_list =library.get(sort_triple,[])+[tuple(sequence[i:i+3])]
			# print(a)

			if len(set(new_list)) == 6:
				result[i+2] = convert_to_char(sum(sort_triple))
				library[sort_triple] = 0
			library[sort_triple] = new_list
	# print(''.join(result))
	return ''.join(result)

